ce, delivery the same within 30 days from notice issued by Buyer-Purchaser. This contract sets out the entire agreement between the Parties. Neither party has entered into this contract in reliance upon any representation, warranty or undertaking of the other party that is not expressly set out or referred to in this contract. (B)This contract - order supersedes any previous agreement or understanding relating to this matter -ORDER. NOTICES: Any notice under this contract shall bewriting (which may include e-mail) any may be served by leaving it or sending it to the address of the other party.', '[]', NULL, NULL, NULL, 1);
