er has provided. The Seller is responsible for faults and damaged goods and takes the responsibility to replace, delivery the same within 30 days from notice issued by Buyer-Purchaser. This contract sets out the entire agreement between the Parties. Neither party has entered into this contract in reliance upon any representation, warranty or undertaking of the other party that is not expressly set out or referred to in this contract. <b>This contract - order supersedes any previous agreement or understanding relating to this matter -ORDER. NOTICES: Any notice under this contract shall be writing (which may include e-mail) any may be served by leaving it or sending it to the address of the other party.</b>', '[\"PLEASE USE GUN METAL WHICH IS ANTIK BLACK TYPE OF FITTING. \",\"INSIDE LABEL TO VERA PELLE . TAG TO BE VERA PELLE . EACH TAG MUST MENTION STYLE BAR CODE AND COLOUR LEATHER WASHED COW \",\"ARTWORK AND COUNTER SAMPLES SHOULD BE APPROVED BY US LATEST BY 25TH OF JUNE 2024\",\"OPEN DEFECTS, MARKS AND FLAWS ARE A SIGN OF DEFECT AND WILL NOT BE ACCEPTED BY US \",\"PLEASE USE DOG HOOKS WHERE MENTIONED ON THE ORDER \",\"EACH BAG BASE NEEDS TO HAVE A CROSS STICHING TO FIX THE LINING OF THE BAG IN WASHED BAGS WHICH IS A MANDATORY REQUIREMENT FROM BAARON GMBH\",\"EACH BAG TO BE SEMI FILLED WITH MILK WHITE PAPER, WRAPPED IN BUTTER PAPER. PLEASE DONOT USE TRANSPARENT PLASTIC PACKINGS\",\"REQUEST YOU TO SEND US ALL THE 3 D DIMENSIONS OF THE ORDERED BAGS SO THAT WE CAN MENTION THE SAME IN OUR CATALOGUES \"]', NULL, NULL, NULL, 1);
